export function getIconForLanguageExtension(language: string) {
  switch (language) {
    case "json":
      return <Icons.Json />;
    case "css":
      return <Icons.Css />;
    case "js":
      return <Icons.Js />;
    case "ts":
    case "typescript":
      return <Icons.Ts />;
    case "jsx":
    case "tsx":
      return <Icons.ReactIcon />;
    default:
      return <FileIcon />;
  }
}

export function getIconForPackageManager(manager: string) {
  switch (manager) {
    case "pnpm":
      return <Icons.Pnpm />;
    case "yarn":
      return <Icons.Yarn />;
    case "npm":
      return <Icons.Npm />;
    case "bun":
      return <Icons.Bun />;
    default:
      return <TerminalSquareIcon />;
  }
}
